INSERT INTO limited_coastal_areas (`code`, `area_name`, `order`) VALUES ('7号-25', '　ただし､和歌山県森戸崎から１６０度に引いた線以西､高知県御岬から１３０度に引いた線以北､愛媛県見舞埼から大分県黒津ノ鼻まで引いた線以北、同県亀埼から山口県地蔵鼻まで引いた線以東の本州、四国及び九州の各海岸線から２０海里以内の水域並びに船舶安全法施行規則第１', '1');
INSERT INTO limited_coastal_areas (`code`, `area_name`, `order`) VALUES ('7号-20', '　ただし､和歌山県和深崎から２１０度に引いた線以西､高知県松ケ鼻から１３０度に引いた線以北､愛媛県遠藤埼から大分県姫島桂ケ岳鼻まで引いた線以北、同桂ケ岳鼻から山口県竜宮埼まで引いた線以東の水域であって、本州及び四国の各海岸から２０海里以内の水域並びに船舶安全', '2');
INSERT INTO limited_coastal_areas (`code`, `area_name`, `order`) VALUES ('7号-15', '　ただし､和歌山県市江崎から徳島県網代埼まで引いた線、愛媛県襖埼から山口県竜宮埼から１８０度１５海里の地点まで引いた線、同地点から同竜宮鼻まで引いた線及び陸岸により囲まれた水域のうち海岸から１２海里以内の水域並びに船舶安全法施行規則第１条第項の水域に限る。', '3');
INSERT INTO limited_coastal_areas (`code`, `area_name`, `order`) VALUES (' 7号-12', '　ただし､和歌山県市江崎から徳島県網代埼まで引いた線、愛媛県　埼から山口県竜宮埼から１８０度１５海里の地点まで引いた線、同地点から同竜宮鼻まで引いた線及び陸岸により囲まれた水域のうち海岸から１２海里以内の水域並びに船舶安全法施行規則第１条第項の水域に限る。', '4');
INSERT INTO limited_coastal_areas (`code`, `area_name`, `order`) VALUES ('7号-10', '　ただし、次のａからｃの各地点（ａ和歌山県切目埼，ｂ同切目埼から２３０度１８０００メートルの地点，ｃ徳島県旧吉野川口右岸）を順次結んだ線、ｄからｇの各地点（ｄ愛媛県肱川口左岸，ｅ山口県八島平根埼から１８０度１００００メートルの地点，ｆ同県祝島西端から２７', '5');
INSERT INTO limited_coastal_areas (`code`, `area_name`, `order`) VALUES ('7号-5', '　ただし、次のａからｅの各地点（ａ和歌山県日ノ御埼，ｂ同日ノ御埼から２８０度９０００メートルの地点，ｃ同県宮崎ノ鼻から２９０度１２０００メートルの地点，ｄ兵庫県淡路島潮埼から１５０度９０００メートルの地点，ｅ同島潮埼）を順次結んだ線、ｆからｈの各地点（ｆ', '6');
INSERT INTO limited_coastal_areas (`code`, `area_name`, `order`) VALUES ('MJ可搬', '　ただし、当該船舶が安全に発着できる任意の地点から１５海里以内の水域のうち、当該地点における海岸から２海里以内の水域及び船舶安全法施行規則第１条第項の水域内の陸岸から２海里以内の水域に限る。', '7');
INSERT INTO limited_coastal_areas (`code`, `area_name`, `order`) VALUES ('田辺-25', '　ただし、和歌山県駒埼から１３０度に引いた線以西、徳島県鹿ノ首埼から１５０度に引いた線、同県和田ノ鼻から兵庫県淡路島潮埼まで引いた線及び同島仏埼から同県揖保川口右岸まで引いた線以東の水域であって本州及び四国の各海岸から２０海里以内の水域並びに船舶安全法施', '8');
INSERT INTO limited_coastal_areas (`code`, `area_name`, `order`) VALUES ('35号-15', '　ただし、京都府博えき岬から０度に引いた線と、福井県敦賀市を経て、石川県塩屋港東防波堤灯台から３１０度に引いた線の間における本州の海岸から１５海里以内の水域及び船舶安全法施行規則第１条第６項の水域に限る。', '9');
INSERT INTO limited_coastal_areas (`code`, `area_name`, `order`) VALUES ('33号-15', '　ただし、兵庫県柴山港灯台から０度に引いた線と、京都府舞鶴市を経て、福井県岡埼から３００度に引いた線の間における本州の海岸から１５海里以内の水域及び船舶安全法施行規則第１条第６項の水域に限る。', '10');
INSERT INTO limited_coastal_areas (`code`, `area_name`, `order`) VALUES ('5号-25', '　ただし、静岡県太田川口右岸から１８０度に引いた線と、三重県大王埼を経て、和歌山県森戸埼から１３５度に引いた線の間における本州の海岸から２０海里以内の水域及び船舶安全法施行規則第１条第６項の水域に限る。', '11');
INSERT INTO limited_coastal_areas (`code`, `area_name`, `order`) VALUES ('ﾎﾞｰﾄ可搬', '　ただし、当該船舶が安全に発着できる任意の地点から５海里以内の水域のうち、当該地点における海岸から３海里以内の水域及び船舶安全法施行規則第１条第項の水域に限る。', '12');
INSERT INTO limited_coastal_areas (`code`, `area_name`, `order`) VALUES ('田辺-20', '　ただし、和歌山県潮岬から２２０度に引いた線以西、徳島県網代埼から１３０度に引いた線以北、同県大磯埼から兵庫県淡路島潮埼まで引いた線、同島江井埼から３３０度に引いた線及び陸岸により囲まれた水域のうち本州及び四国の各海岸から１５海里以内の水域並びに船舶安全', '13'); 
